import { useEffect, useState} from "react";
import axios from "axios";


import "./App.css"


function App(){
  const perguntas = response.data;
  
  //const url = "http://localhost:8003/PerguntaSelecionadaPacientes";
  
  async function getPerguntas() {
    try {
      // Requisição à API usando Axios
      const response = await axios.get('/PerguntaSelecionadaPacientes');
  
      // Acessando os dados da resposta
      const perguntas = response.data;
  
      // Exibir os dados no frontend (Exemplo)
      console.log(perguntas);
  
      // Manipular os dados de acordo com a necessidade da sua aplicação
  
    } catch (error) {
      // Tratar erros da requisição
      console.error(error);
      alert('Erro ao buscar perguntas!');
    }
  }
  getPerguntas();


  

  return(
    <div className="App" >  
    <div  className="Colum"> 
      <div className="cont">
          <center><h2  >Selecionar Pergunta</h2></center>
          
            <div>
            { perguntas.map(( pergunta) => (
              <div key={ pergunta._id}>
                  <h2>{pergunta.pergunta}</h2>
                  <p>{pergunta.infoPaciente}</p>
              </div>
            ))}
            </div>
              
              </div> 
          
            </div>
          
      </div>
 
  )
}

export default App
